import React, { useState } from "react";

const Contact = () => {
  const [val, upVal]=useState({
   fname:'',
  });

  const thisVal=(obj)=>{
    upVal()
  }

  const sent=(obj)=>{
obj.preventDefault();
  }
  return (
    <>
      <div>
        <h1 className=' text-center mt-5 my-3'>Contact me</h1>
      </div>
      <div className='container'>
        <div className="row">
          <div className='col-lg-10 mx-auto col-10 my-5'>
            <form onSubmit={sent}>
              <div class="mb-3">
                <label for="exampleFormControlInput1" class="form-label">Name</label>
                <input onChange={thisVal} name='Nm' required type="text" class="form-control" placeholder="Enter Your Full Name" />
                <label for="exampleFormControlInput1" class="form-label">PHONE</label>
                <input onChange={thisVal} name='' required type="password" class="form-control" placeholder="Enter your Mobile No" />
                <label for="exampleFormControlInput1" class="form-label">Email</label>
                <input onChange={thisVal} name='' required type="email" class="form-control" id="exampleFormControlInput1" placeholder="name@example.com" />
              </div>
              <div class="mb-3">
                <label for="exampleFormControlTextarea1" class="form-label">Message</label>
                <textarea class="form-control" placeholder="Enter your suggestion" rows="3"></textarea>
                <div className="text-center my-4 cen">
                <button type="submit" class="btn   btn-outline-primary">Submit</button>
                </div>
              </div>
            </form>
          </div>

        </div>
      </div>
    </>
  )
}
export default Contact;
